Here is my attempt at drawing a line and a guitar in Processing without using any transformations:

```processing
void setup() {
  size(400, 400);
  stroke(0);
  strokeWeight(3);
}

void draw() {
  // Draw the line at the top
  line(0, 30, width, 30);

  // Draw the guitar body
  noStroke();
  fill(200, 100, 0);
  quad(50, 100, 150, 100, 200, 150, 100, 150);

  // Draw the guitar neck
  stroke(0);
  line(150, 100, 150, 30);

  // Draw the tuning pegs
  stroke(0);
  line(140, 30, 150, 30);
  line(160, 30, 170, 30);

  // Draw the frets
  for (int i = 0; i < 5; i++) {
    line(150, 30 + i*20, 190, 30 + i*20);
  }

  // Draw the bridge
  stroke(0);
  line(50, 150, 100, 150);

  // Draw the pickguard
  noStroke();
  fill(255);
  quad(110, 120, 130, 120, 140, 140, 120, 140);

  // Draw the sound hole
  ellipse(125, 125, 50, 50);

  // Draw the strings
  for (int i = 30; i < 150; i += 20) {
    line(150, i, 190, i);
  }
}
```

This draws a horizontal line at the top, then proceeds to draw the various parts of an acoustic guitar - the body, neck, tuning pegs, frets, bridge, pickguard, sound hole, and strings. Let me know if you would like me to explain or clarify any part of the code. I aimed to include as much detail as possible in the guitar drawing using only basic shapes, without relying on any transformations.

